import Layout from '../components/Layout';

const Contact = () => (
  <Layout>
    <div>
      <h1>Contact</h1>
      <p>David Lopez 
         <br/> Email David.Lopez@hyperisland.se
          <br/>Phone : 707780443
          <br/>Facebook: David.Lopez

      </p>
    </div>
  </Layout>
);

export default Contact;
